const api = {
  key: "399ae63a0197a6d1f868b6d1a321df53",
  base: "https:api.openweathermap.org/data/2.5/"
}

function App() {
  return (
    <div className="app">
     <main>
       <div className="search-box">
         <input
         type="text"
         className="search-bar"
         placeHolder="Search..."
         />
       </div>
     </main>
    </div>
  );
}

export default App;
